import React, { useState } from 'react';

const AddProductForm = ({ onProductAdded }) => {
  const [product, setProduct] = useState({
    name: '',
    price: '',
    category: '',
    description: '',
    image: null,
  });

  const [descriptionTemplate, setDescriptionTemplate] = useState('');

  const handleInputChange = e => {
    const { name, value } = e.target;
    setProduct(prev => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleDescriptionTemplateChange = e => {
    const { value } = e.target;
    setDescriptionTemplate(value);
    setProduct(prev => ({
      ...prev,
      description: value,
    }));
  };

  const handleImageChange = e => {
    setProduct(prev => ({
      ...prev,
      image: e.target.files[0],
    }));
  };

  const handleSubmit = e => {
    e.preventDefault();
    // Додавання нового продукту через API
    onProductAdded(product);
    setProduct({
      name: '',
      price: '',
      category: '',
      description: '',
      image: null,
    });
  };

  return (
    <form
      onSubmit={handleSubmit}
      style={{
        maxWidth: '600px',
        margin: 'auto',
        padding: '20px',
        border: '1px solid #ddd',
        borderRadius: '8px',
        boxShadow: '0 0 8px rgba(0, 0, 0, 0.1)',
      }}
    >
      <h3 style={{ textAlign: 'center', marginBottom: '20px' }}>
        Add New Product
      </h3>
      <div style={{ marginBottom: '15px' }}>
        <label
          htmlFor="name"
          style={{ display: 'block', fontWeight: 'bold', marginBottom: '5px' }}
        >
          Name:
        </label>
        <input
          type="text"
          name="name"
          id="name"
          value={product.name}
          onChange={handleInputChange}
          style={{
            width: '100%',
            padding: '8px',
            borderRadius: '4px',
            border: '1px solid #ddd',
          }}
        />
      </div>
      <div style={{ marginBottom: '15px' }}>
        <label
          htmlFor="price"
          style={{ display: 'block', fontWeight: 'bold', marginBottom: '5px' }}
        >
          Price:
        </label>
        <input
          type="number"
          name="price"
          id="price"
          value={product.price}
          onChange={handleInputChange}
          style={{
            width: '100%',
            padding: '8px',
            borderRadius: '4px',
            border: '1px solid #ddd',
          }}
        />
      </div>
      <div style={{ marginBottom: '15px' }}>
        <label
          htmlFor="category"
          style={{ display: 'block', fontWeight: 'bold', marginBottom: '5px' }}
        >
          Category:
        </label>
        <select
          name="category"
          id="category"
          value={product.category}
          onChange={handleInputChange}
          style={{
            width: '100%',
            padding: '8px',
            borderRadius: '4px',
            border: '1px solid #ddd',
          }}
        >
          <option value="">Select Category</option>
          <option value="Building Materials">Building Materials</option>
          <option value="Furniture">Furniture</option>
          <option value="Electronics">Electronics</option>
        </select>
      </div>
      <div style={{ marginBottom: '15px' }}>
        <label
          htmlFor="description"
          style={{ display: 'block', fontWeight: 'bold', marginBottom: '5px' }}
        >
          Description:
        </label>
        <select
          id="description"
          value={descriptionTemplate}
          onChange={handleDescriptionTemplateChange}
          style={{
            width: '100%',
            padding: '8px',
            borderRadius: '4px',
            border: '1px solid #ddd',
          }}
        >
          <option value="">Select Description Template</option>
          <option value="This product is perfect for your home, easy to apply and has high quality.">
            Standard Home Product Description
          </option>
          <option value="This cement is designed for construction and repair, with high durability and strength.">
            Cement Description
          </option>
          <option value="This furniture is durable, elegant, and perfect for any modern living space.">
            Furniture Description
          </option>
        </select>
      </div>
      <div style={{ marginBottom: '15px' }}>
        <label
          htmlFor="image"
          style={{ display: 'block', fontWeight: 'bold', marginBottom: '5px' }}
        >
          Image:
        </label>
        <input
          type="file"
          id="image"
          onChange={handleImageChange}
          style={{
            padding: '8px',
            borderRadius: '4px',
            border: '1px solid #ddd',
          }}
        />
      </div>
      <button
        type="submit"
        style={{
          backgroundColor: '#007bff',
          color: '#fff',
          padding: '10px 20px',
          borderRadius: '4px',
          border: 'none',
          cursor: 'pointer',
        }}
      >
        Add Product
      </button>
    </form>
  );
};

export default AddProductForm;
